import axios from 'axios'
export const traerTodos= () => (dispatch) => { //este dispatch contacta al reducer para que haga el cambio de estado
const respuesta = axios.get('https://jsonplaceholder.typicode.com/users');

dispatch({
type: 'traer_usuarios',
payload: respuesta.data
})
}
